import Link from 'next/link';

const date = () => {

  let days = [
    'Domingo',
    'Lunes',
    'Martes',
    'Miércoles',
    'Jueves',
    'Viernes',
    'Sábado'
  ],
    months = [
      'Enero',
      'Febrero',
      'Marzo',
      'Abril',
      'Mayo',
      'Junio',
      'Julio',
      'Agosto',
      'Septiembre',
      'Octubre',
      'Noviembre',
      'Diciembre'
    ],
    date = new Date();

  const displayDate =
    days[date.getDay()] +
    ', ' +
    months[date.getMonth()] +
    ' ' +
    date.getDate() +
    ', ' +
    date.getFullYear();

  return displayDate;
}

const Menu = ({ items }) => {

  return (

    <>
      <div className="row menu">
        <div className="col">

          <ul>
            {items.map(item => (

              <li>
                <Link href="{item.link}">{item.text}</Link>

                <div hidden={!item.sub} className="bg"></div>

                <ol hidden={!item.sub}>

                  {item.sub.map(sub => (
                    <li><Link href="{sub.link}">{sub.text}</Link></li>
                  ))}

                </ol>

              </li>

            ))}
          </ul>

        </div>
      </div>

    </>
  )
}


export default Menu;
